import axios from "axios"
import { useEffect, useState } from "react"
import { Link } from "react-router-dom"

function Cateogiers(){
const [data,setdata]=useState([])
useEffect(()=>{
fetch("http://localhost:9000/Cateogiers")
.then(res=>res.json())
.then(data=>setdata(data))
})
function Delete(Id){
    axios(`http://localhost:9000/Cateogiers/${Id}`,{
        method:"DELETE"
        
    })
    

}


return(
<div>
<h2>Cateogiers</h2>
<Link to={"/Cateogiers/Add1"} className="btn btn-success">Add New Cateogiers</Link>

<table className="table table-striped">
<thead>
<tr>
<th>ID</th>
<th>Title</th>
<th>Price</th>
<th>Operiton</th>
</tr>
</thead>
<tbody>
{data.map((Cateogiers)=>
{
    return(
<tr key={Cateogiers.id}>
<td >{Cateogiers.id}</td>
<td >{Cateogiers.title.slice(0,50)}...</td>
<td>{Cateogiers.price }$</td>
<td>
<button onClick={()=>Delete(Cateogiers.id)} className="btn btn-danger me-1 btn-sm" >Delete</button>
<Link to={`/Cateogiers/${Cateogiers.id}`} className="btn btn-info me-1 btn-sm">View</Link>
<button   className="btn btn-primary btn-sm">Edit</button>
</td>
</tr>       
    )
})}
</tbody>
</table>
       
        </div>
    )
}
export default Cateogiers
